import styled from 'styled-components';

export const HomeContainer = styled.div`
    background: white;
    display: flex;
    justify-content: center;
    align-items: center;
    padding: 0 30px;
    height: 800px;
    position: relative;
    z-index: 1;

`;

export const HomeBackground = styled.div`
    position: absolute;
    top: 0;
    right: 0;
    bottom: 0;
    left: 0;
    width: 100%;
    height: 100%
    overflow: hidden;
`;

export const Homeh1 = styled.h1`
    font-size: 250px;
    color: yellow;
    text-align: center;
    margin-top: 40%;
`;

export const Homeh3 = styled.h3`
    font-size: 50px;
    color: yellow;
    text-align: center;
`;
